    await delay(1000)
    const settingScreen = await client.$('//android.widget.Button[4]')
    await settingScreen.click()
    await delay(1000)
    const logoutButton = await client.$("//android.widget.Button[@index='0']")
    logoutButton.click()
    await delay(4000)
  });
});

